    false,nt"url": null,nt"notes": "The Kanayut River area in the Chandler
    Lake Quadrangle, North Slope, Alaska, is located in the foothills of the Endicott
    Mountains. It is one of a series of areas selected for detailed mapping to document
    important structural and stratigraphic relationships at the mountain front of the
    east-central Brooks Range. This publication presents a geological map, cross section,
    correlation of map units, location index, and map unit descriptions.",nt"license_title":
